(byte, byte, byte, byte) Split(uint u)
{
    return (
        (byte)((u & 0xFF000000) >> 24),
        (byte)((u & 0x00FF0000) >> 16),
        (byte)((u & 0x0000FF00) >> 8),
        (byte)(u & 0x000000FF)
    );
}

uint Combine(byte x, byte y, byte z, byte w)
{
    return ((uint)x) << 24 | ((uint)y) << 16 | ((uint)z) << 8 | (uint)w;
}

uint ArgbToABGR((byte a, byte r, byte g, byte b) argb)
{
    return Combine(argb.a, argb.b, argb.g, argb.r);
}

uint[] Convert(uint[] argb, Func<(byte, byte, byte, byte), uint> f)
{
    return argb.Select(x => f(Split(x))).ToArray();
}

void Print(string name, uint w, uint h, uint[] array)
{
    StringBuilder sb = new();
    string dataName = name.ToUpperInvariant() + "_DATA";
    sb.AppendLine("use crate::bitmap::Bitmap;");
    sb.AppendLine();
    sb.AppendLine($"// {w} x {h}");
    sb.AppendLine($"const {dataName}: [u32;{w * h}] = [");
    sb.Append("    ");
    foreach (var i in array)
    {
        sb.Append($"0x{i:X8},");
    }
    sb.AppendLine();
    sb.AppendLine("];");
    sb.AppendLine(@$"
pub(crate) const {name.ToUpperInvariant()}: Bitmap = Bitmap {{
    data: &{dataName},
    w: {w},
    h: {h},
}};");
    Console.WriteLine(sb.ToString());
    File.WriteAllText("C:\\Users\\theor\\rillus\\sample\\sample-rust\\src\\sprites\\" + name + ".rs", sb.ToString());
}

